window.bookSummaryJSON = "<p>What would you do if you were the most powerful dungeon deity in the world and the bindings keeping you trapped within your dungeon were broken? Would you escape? Would you acquire a party of beautiful female minions? Would you use your new minions to conquer other dungeon deities, consume their magic, and grow even more powerful? Would you take over the world? Would you then take over the heavens and destroy the gods?</p> <p>Yes, you would do all of the above.</p>"; 
